<p>To address the first challenge, eTainter propagates the taint to the slot that stores the length of an array/mapping when one of its slots is tainted. For the second challenge, eTainter resolves address dependencies by propagating constants through EVM instructions that derive the address. When a precise address cannot be resolved, eTainter over-approximates and considers the whole array or mapping as tainted</p>
